one thing I really appreciate from matlab are the zeros and ones functions, here is the #rstats version for them

zeros &lt;- function(n, m=NULL) {
  if(is.null(m)) m &lt;- n
  return(matrix(0,n,m))
}

ones &lt;- function(n, m=NULL) {
  if(is.null(m)) m &lt;- n
  return(matrix(1,n,m))
}

